function App() {
    return (<ExpenseItem
        name="Car Insurance"
        price="293.4"
        date="12th January 2022"
    />)(
        <ExpenseItem
            name="Skola Kur'ana"
            price="$15"
            date="31th November 2022"
        />
    );
}

export default App;
